import React, { useState } from 'react';
import { BsSend } from 'react-icons/bs';

const ChatGptUi = () => {
    const [searchQ, setSearchQ] = useState('');

    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', minHeight: '90vh', background: 'black', color: 'white', margin: '20px 250px', justifyContent: 'space-between' }}>
            <div style={{ height: '50vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                {/* Content above the input field */}
                <div>
                    <h1>Welcome to the ChatGpt UI</h1>
                    <p>Some text or components can go here...</p>
                </div>
            </div>
            <div style={{ width: '100%', display: 'flex', justifyContent: 'center' }}>
                <div style={{ position: 'relative', width: '50vw' }}>
                    <input
                        style={{ width: '100%', fontSize: '20px', padding: '5px', color: 'black', border: '1px solid black', paddingRight: '35px' }}
                        placeholder="Enter the story"
                        value={searchQ}
                        onChange={(e) => setSearchQ(e.target.value)}
                    />
                    <div style={{ position: 'absolute', right: '10px', top: '50%', transform: 'translateY(-50%)' }}>
                        <BsSend />
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ChatGptUi;
